import React from 'react';
import "./Login.css"

export default class Login extends React.Component{
    constructor() {
        super();
    }
    render() {
        return(
            <div className="login-container">
                <form>
                    <input type="number"/>
                    <input type="password"/>
                    <button type="submit">登录/注册</button>
                </form>
            </div>
        )
    }
}
